    return(

        <ErrorBoundary>



           <Route

                {...rest} 

                render={

                    (props) => {

                            return (

                                <>

                                    <div className="main-wrapper max-height">

                                        {/* <Header/>  */}

                                        <Component  {...props} /> 

                                        {/* <Footer/> */}

                                    </div>

                                </>

                            )

                    }
                }

            /> 

        </ErrorBoundary>
    );
}
